import AuthProvider from './AuthProvider';  // Adjusted path to be inside src
import './css/App.css';  // Corrected path to the CSS file inside the src folder
import Router from "./routes/RouterApp"; // halaman-halaman
import AxiosInterceptor from "./api/axiosInterceptor";


const App = () => {
  return (
    <AuthProvider>
      <AxiosInterceptor />
      <Router />
    </AuthProvider>
  );
};

export default App;
